import Namespace from './namespace';
import Storage from './storage';
import Resolver from './resolver';
import mapPath from './map-path';

/**
 * Creates a new Container.
 * @class
 * @classdesc Represents a container for registered modules.
 */
export default class Container extends Namespace {
    /**
     * Converts object/array to a function chain that's help to use namespaces.
     */
    static map = mapPath;

    /** @constructs
     * @param {string} separator - Namespace separator. Optional. Default '/'.
     */
    constructor(separator = '/') {
        super(separator, '', new Storage(separator));
        this._resolver = new Resolver(this._storage);
    }

    /**
     * Determines whether a module with passed path exists.
     * @param {string} path - Module's path.
     * @return {boolean} Value that determines whether a module with passed path exists.
     */
    contains(path) {
        return this._storage.contains(path);
    }

    /**
     * Resolve a module.
     * @param {string} path - Module namespace.
     * @returns {Module} new Module.
     */
    resolve(path) {
        return this._resolver.resolve(path);
    }

    /**
     * Resolves all modules from particular namespace.
     * @param {string} namespace - Target namespace.
     * @returns {Map<string, any>} Map of module values, where key is module name.
     */
    resolveAll(namespace) {
        return this._resolver.resolveAll(namespace);
    }
}

import {
  isArray,
  isObject,
  isString,
  forEach,
  joinPath
} from './utils';

function create(separator, parentPath, current) {
    return function path(name) {
        return joinPath(separator, parentPath, current, name);
    };
}

function transform(separator, parent, current) {
    forEach(current, (val, key) => {
        if (isString(val)) {
            parent[key] = create(separator, parent(), val);
        } else if (isArray(val)) {
            parent[key] = create(separator, parent(), key);

            forEach(val, i => {
                parent[key][i] = create(separator, parent[key](), i);
            });
        } else if (isObject(val)) {
            parent[key] = create(separator, parent(), key);
            transform(separator, parent[key], val);
        }
    });

    return parent;
}

export default function createPathMap(target, separator = '/') {
    return transform(separator, create(separator), target);
}

import { isFunction } from './utils';

/**
 * Creates a new Module.
 * @class
 * @classdesc Represents a module.
 */
export default class Module {
    constructor(namespace, name, dependencies, initialize) {
        this._namespace = namespace;
        this._name = name;
        this._initialize = initialize;
        this._dependencies = dependencies;
        this._isInitialized = false;
        this._value = null;
    }

    /**
     * Returns module namespace.
     * @returns {string} Module namespace.
     */
    getNamespace() {
        return this._namespace;
    }

    /**
     * Returns module name.
     * @returns {string} Module name.
     */
    getName() {
        return this._name;
    }

    /**
     * Returns a list of module dependencies.
     * @returns {(Array<string>|undefined)} List of module dependencies.
     */
    getDependencies() {
        return this._dependencies;
    }

    /**
     * Returns initialized module value.
     * @returns {any} Modules value.
     * @throws {Error} Throws error if modules is not initialized.
     */
    getValue() {
        if (!this.isInitialized()) {
            throw new Error('Module is not initialized!');
        }

        if (isFunction(this._value)) {
            return this._value();
        }

        return this._value;
    }

    /**
     * Returns value that determines whether module is initialized.
     * @returns {boolean} Value that determines whether module is initialized.
     */
    isInitialized() {
        return this._isInitialized;
    }

    /**
     * Initializes module.
     * @throws {Error} Throws error if modules is already initialized.
     */
    initialize(dependencies) {
        if (this.isInitialized()) {
            throw new Error(`Module has been already initialized!`);
        }

        this._value = this._initialize(dependencies);
        this._isInitialized = true;
    }
}

import {
    isFunction,
    create,
    parseArgs,
    joinPath
} from './utils';
import Module from './module';

/**
 * Creates a new Namespace.
 * @class
 * @classdesc Represents a module namespace.
 */
export default class Namespace {

    /** @constructor
     * @param {string} separator - Namespace separator.
     * @param {string} name - Namespace name.
     * @param {Storage} storage - Global modules storage.
     */
    constructor(separator = '/', name = '', storage) {
        this._separator = separator;
        this._name = name;
        this._storage = storage;
    }

    /**
     * Returns a namespace name.
     * @returns {string} Namespace name.
     */
    getName() {
        return this._name;
    }

    /**
     * Returns a module namespace.
     * @param {string} name - Module namespace. Optional.
     * @returns {Namespace} Module namespace.
     */
    namespace(name) {
        return new Namespace(this._separator, joinPath(this._separator, this._name, name), this._storage);
    }

    /**
     * Register a value, such as a string, a number, an array, an object or a function.
     * @param {string} name - Module name.
     * @param {(string|number|object|array|function)} definition - Module value.
     * @returns {function} Value.
     */
    const(name, definition) {
        const args = parseArgs(name, definition);

        this._storage.addItem(new Module(this._name, args.name, args.dependencies, function initialize() {
            return function factory() {
                return args.definition;
            };
        }));
    }

    /**
     * Register a value, such as a string, a number, an array, an object or a constructor.
     * Note: If passed value is function type, it will be treated as constructor
     * and every time when it's injected, new instance will be created.
     * @param {string} name - Module name.
     * @param {array} dependencies - Module dependencies. Optional.
     * @param {(string|number|object|array|function)} definition - Module value.
     * @returns {function} Value factory.
     */
    value(name, dependencies, definition) {
        const args = parseArgs(name, dependencies, definition);

        this._storage.addItem(new Module(this._name, args.name, args.dependencies, function initialize(resolved) {
            // instances, simple types
            if (!isFunction(args.definition)) {
                return args.definition;
            }

            return function factory() {
                return create(args.definition, resolved);
            };
        }));
    }

    /**
     * Register a service constructor, which will be invoked with `new` to create the service instance.
     * Any type which was registered as a service is singleton.
     * @param {string} name - Module name.
     * @param {array} dependencies - Module dependencies. Optional.
     * @param {function} definition - Module constructor that will be instantiated.
     * @returns {function} Value factory.
     */
    service(name, dependencies, definition) {
        const args = parseArgs(name, dependencies, definition);

        if (!isFunction(args.definition)) {
            throw new Error(`Service supports only constructors.`);
        }

        this._storage.addItem(new Module(this._name, args.name, args.dependencies, function initialize(resolved) {
            return create(args.definition, resolved);
        }));
    }

    /**
     * Register a service factory, which will be called to return the service instance.
     * Any function's value will be registered as a singleton.
     * @param {string} name - Module name.
     * @param {array} dependencies - Module dependencies. Optional.
     * @param {function} definition - Module factory.
     * @returns {function} Value factory.
     */
    factory(name, dependencies, definition) {
        const args = parseArgs(name, dependencies, definition);

        if (!isFunction(args.definition)) {
            throw new Error(`Factory supports only functions.`);
        }

        this._storage.addItem(new Module(this._name, args.name, args.dependencies, function initialize(resolved) {
            return args.definition(...resolved);
        }));
    }
}

import { isArray } from './utils';

/**
 * Creates a new Resolver.
 * @class
 * @classdesc Represents a dependency resolver for particular module.
 */
export default class Resolver {
    /**
     * @constructor
     * @param storage - Module's storage.
     */
    constructor(storage) {
        this._storage = storage;
    }

    /**
     * Resolves particular module.
     * @returns {any} Module's value.
     */
    resolve(path) {
        const resolveModule = (targetPath) => {
            const module = this._storage.getItem(targetPath);

            if (module.isInitialized()) {
                return module.getValue();
            }

            const deps = module.getDependencies();
            let resolvedDeps = [];
            if (isArray(deps)) {
                resolvedDeps = deps.map(resolveModule);
            }

            module.initialize(resolvedDeps);
            return module.getValue();
        };

        return resolveModule(path);
    }

    /**
     * Resolves all modules from particular namespace.
     * @param {string} namespace - Target namespace.
     * @returns {Map<string, any>} Map of module values, where key is module name.
     */
    resolveAll(namespace) {
        const result = {};

        this._storage.forEachIn(namespace, (module, path) => {
            result[module.getName()] = this.resolve(path);
        });

        return result;
    }
}

import Module from './module';
import {
    splitPath,
    joinPath,
    isString,
    isNullOrUndefined,
    isFunction,
    isValidName
} from './utils';

const MISSED_MODULE = 'Missed module!';
const MISSED_MODULE_NAME = 'Missed module name!';
const MISSED_NAMESPACE = 'Missed module namespace!';
const MISSED_CALLBACK = 'Missed callback';
const INVALID_MODULE = 'Invalid module!';
const INVALID_NAMESPACE = 'Invalid namespace!';
const INVALID_MODULE_NAME = 'Invalid module name!';
const INVALID_MODULE_PATH = 'Invalid module path!';
const NAMESPACE_NOT_FOUND = 'Namespace was not found';
const MODULE_NOT_FOUND = 'Module with path was not found';

/**
 * Creates a new Storage.
 * @class
 * @classdesc Represents a modules storage.
 */
export default class Storage {
    constructor(pathSeparator = '/') {
        this._separator = pathSeparator;
        this._namespaces = {};
    }

    /**
     * Adds module to storage.
     * @param {Module} module - Target module to add.
     * @throws {Error} Throws an error if module with same path already exists.
     */
    addItem(module) {
        if (!module) {
            throw new Error(MISSED_MODULE);
        }

        if (!(module instanceof Module)) {
            throw new Error(INVALID_MODULE);
        }

        const namespace = module.getNamespace();

        if (!isString(namespace)) {
            throw new Error(INVALID_NAMESPACE);
        }

        const name = module.getName();

        if (!name) {
            throw new Error(MISSED_MODULE_NAME);
        }

        if (!isString(name)) {
            throw new Error(INVALID_MODULE_NAME);
        }

        if (!isValidName(this._separator, name)) {
            throw new Error(`${INVALID_MODULE_PATH} Module is now alllowed to contain namespace separators.`);
        }

        let registry = this._namespaces[namespace];

        if (!registry) {
            registry = {};
            this._namespaces[namespace] = registry;
        }

        if (registry[name]) {
            throw new Error(`${name} is already registered.`);
        }

        registry[name] = module;
    }

    /**
     * Tries to find a module with passed path.
     * @param {string} path - Module's path.
     * @return {Module} found module.
     * @throws {Error} Throws error in module wasn't found.
     */
    getItem(path) {
        if (!isString(path)) {
            throw new Error(INVALID_MODULE_PATH);
        }

        const parts = splitPath(this._separator, path);
        const namespace = this._namespaces[parts.namespace];

        if (!namespace) {
            throw new Error(`${NAMESPACE_NOT_FOUND}: ${parts.namespace}!`);
        }

        const module = namespace[parts.name];

        if (!module) {
            throw new Error(`${MODULE_NOT_FOUND}: ${parts.name}!`);
        }

        return module;
    }

    /**
     * Determines whether a module with passed path exists.
     * @param {string} path - Module's path.
     * @return {boolean} Value that determines whether a module with passed path exists.
     */
    contains(path) {
        if (!isString(path)) {
            throw new Error(INVALID_MODULE_PATH);
        }

        const parts = splitPath(this._separator, path);
        const namespace = this._namespaces[parts.namespace];

        if (!namespace) {
            return false;
        }

        const module = namespace[parts.name];

        if (!module) {
            return false;
        }

        return true;
    }

    forEachIn(namespace, callback) {
        if (isNullOrUndefined(namespace)) {
            throw new Error(MISSED_NAMESPACE);
        }

        if (!isFunction(callback)) {
            throw new Error(MISSED_CALLBACK);
        }

        const registry = this._namespaces[namespace];

        if (!registry) {
            throw new Error(`${NAMESPACE_NOT_FOUND}: ${namespace}!`);
        }

        for (const name in registry) {
            if (registry.hasOwnProperty(name) && registry[name]) {
                callback(registry[name], joinPath(this._separator, namespace, name));
            }
        }
    }
}

const toString = Object.prototype.toString;

export function isUndefined(value) {
    return typeof value === 'undefined';
}

export function isNull(value) {
    return value === null;
}

export function isNullOrUndefined(arg) {
    return isNull(arg) || isUndefined(arg);
}

export function isObject(value) {
    return value !== null && typeof value === 'object';
}

export function isString(value) {
    return typeof value === 'string';
}

export function isFunction(value) {
    return typeof value === 'function';
}

export function isArray(value) {
    return toString.call(value) === '[object Array]';
}

export function create(constructor, args) {
    function Temp() {}
    Temp.prototype = constructor.prototype;
    const instance = new Temp();
    const result = constructor.apply(instance, args);
    return Object(result) === result ? result : instance;
}

export function parseArgs(...args) {
    const name = args[0];
    let dependencies = args[1];
    let definition = args[2];

    if (isUndefined(definition)) {
        definition = dependencies;
        dependencies = null;
    }

    return { name, dependencies, definition };
}

export function isValidName(separator = '/', name) {
    return name.indexOf(separator) === -1;
}

export function joinPath(separator = '/', ...parts) {
    const paths = [];
    const len = parts.length;

    for (let i = 0; i <= len; i += 1) {
        let part = parts[i];

        if (isString(part)) {
            part = part.trim();

            if (part && part !== separator) {
                paths.push(part);
            }
        }
    }

    return `${paths.join(separator)}`;
}

export function splitPath(separator = '/', path) {
    const result = { namespace: '', name: '' };

    if (!isString(path)) {
        return result;
    }

    const normalizedPath = path.trim();

    if (normalizedPath === separator) {
        result.namespace = '';
        return result;
    }

    const parts = normalizedPath.split(separator);
    const len = parts.length;

    if (len > 1) {
        result.namespace = joinPath(separator, ...parts.slice(0, len - 1));
    } else {
        result.namespace = '';
    }

    result.name = parts[len - 1] || '';

    if (isString(result.name) && !result.name.trim()) {
        result.name = '';
    }

    return result;
}

export function forEach(collection, iteratee, context = this) {
    if (isArray(collection)) {
        for (let i = 0; i < collection.length; i += 1) {
            iteratee.call(context, collection[i], i);
        }
    } else if (isObject(collection)) {
        for (const prop in collection) {
            if (collection.hasOwnProperty(prop)) {
                iteratee.call(context, collection[prop], prop);
            }
        }
    }
}

